import React, { Component } from 'react';
import Automate from 'components/Automate/Automate'
import Camera from './components/Navbar/Components/Camera/Camera'
// import Logout from '../Logout'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";
class Navbar extends Component {
  render() {
    return (
      <div>
      <Router>
      <div>
        <ul>
          <li>
            <Link to="/automate">Automate</Link>
          </li>
          <li>
            <Link to="/camera">Camera</Link>
          </li>
          {/* <li> */}
            {/* <Link to="/logout">Sign Out</Link>
            </li> */}
        </ul>

        <Switch>
            <Route path="/automate">
              <Automate />
            </Route>
            <Route path="/camera">
              <Camera />
            </Route>
            {/* <Route path="/logout">
              <Logout />
            </Route> */}
        </Switch>
      </div>
      </Router>
      </div>
    );
  }
}

export default Navbar;
